css:
/*
@cyan:         #35a766;
@blue:         #5977d3;
@purple:       #8100c6;
@green:        #8fad06;
@red:          #d24d4d;
@orange:       #cd8e21;
@light-orange: #e3a92d;
*/
/* highlighting is the one intentional departure from gtk's styles */
.key-binding-resolver {
  -webkit-flex: 0.25;
  overflow: auto;
}
.key-binding-resolver .keystroke {
  margin-right: 1em;
}
.key-binding-resolver table .used {
  color: #5aa411;
}
.key-binding-resolver table .unused {
  color: #2e3436;
}
.key-binding-resolver table .unmatched {
  color: #8e9192;
}
.key-binding-resolver table .used .command::before,
.key-binding-resolver table .unused .command::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f03a";
}
.key-binding-resolver table .unmatched .command::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f081";
}
.key-binding-resolver table .command,
.key-binding-resolver table .selector,
.key-binding-resolver table .source {
  min-width: 10em;
}
.key-binding-resolver table .source {
  cursor: pointer;
}
